/** GLOBAL  */

body {
	font-family: "Noto Sans JP", Roboto, Arial, Helvetica, sans-serif;
	font-weight: 400;
	letter-spacing: 2px;
	color: #231f1f;
	padding: 8px 0;
	overflow-x: hidden;
	margin: 0;
}

.reveal {
	opacity: 0;
	transform: translateY(20vh) skewX(-15deg);
	transition: all 1s ease-out;
}

.reveal.revealed {
	opacity: 1;
	transform: translateY(0px) skewX(0deg);
}

/** HEADER */

header {
	font-size: 1rem;
	display: grid;
	grid-template-columns: auto 135px 135px 135px;
	align-items: center;
	padding: 5vh 2vw 0;
}

header a.first {
	grid-column-start: 2;
	grid-column-end: 3;
}

header a.second {
	grid-column-start: 3;
	grid-column-end: 4;
}
header span.mode-toggle {
	font-size: 2em;
	grid-column-start: 4;
	grid-column-end: 5;
}

header a {
	transition: color 0.1s linear;
	text-decoration: none;
	color: #666666;
	letter-spacing: 3px;
	padding-bottom: 10px;
	width: fit-content;
}

header a:focus,
header a:hover {
	color: #00e8ac;
	cursor: pointer;
}

header a:focus,
header .mode-toggle:focus {
	outline: none;
	border-bottom: 1px solid #00e8ac;
}

#face {
	z-index: 2;
	position: -webkit-sticky;
	position: sticky;
	width: 200px;
	top: 0;
	height: 206px;
	margin-top: calc(-10vh + -1rem + -8px);
	margin-left: 34px;
	background-image: url(/static/Circle.svg);
	background-size: 0%;
	background-position-x: 50%;
	background-position-y: 50%;
	background-repeat: no-repeat;
	transition: all 1s cubic-bezier(0.165, 0.84, 0.44, 1) 0s;
}

#face.stuck {
	background-size: 100%;
	width: 150px;
}

/** CONTACT PAGE  */

main.contact {
	display: grid;
	height: calc(100vh - 233px);
}

main.contact div {
	margin: 0 auto;
	font-size: 5rem;
	font-weight: bold;
	text-align: center;
	word-break: break-word;
}

main.contact p#email {
	transition: color 0.1s linear;
	cursor: pointer;
}

main.contact p#email:hover,
main.contact p#email:focus {
	color: #00e8ac;
}

main.contact div.contact-message p {
	font-size: 0.23em;
	font-weight: normal;
}

main.contact p:focus {
	outline: none;
	border-bottom: 1px solid #00e8ac;
}

/** Intro  */

section#intro {
	margin: 0 10vw 70vh 30vw;
	max-width: 880px;
	font-size: 2rem;
	letter-spacing: 4px;
}

section#intro p:nth-of-type(1) {
	margin-top: 0;
}
section#intro p:nth-of-type(3) {
	max-width: 656px;
}

.color {
	color: #00e8ac;
}

/** SKILLS  */

section#skills {
	display: grid;
	grid-template-columns: 0.88fr 2fr;
	margin-bottom: 80vh;
	font-size: 1rem;
}

div#skills-animation,
div#work-animation {
	opacity: 0.5;
}

div#skills-animation {
	transform: translateX(-5vw);
}

section#skills div.skills-grid {
	grid-column-start: 2;
	grid-column-end: 3;
	align-self: center;
}

section#skills div.skills-grid h2 {
	font-weight: 500;
	letter-spacing: 4px;
	line-height: 3em;
	border-bottom: 2px solid #ccc;
}

section#skills div.skills-subgrid {
	display: grid;
	max-width: 750px;
	grid-template-columns: 1fr 1fr 1fr 1fr;
	margin-top: 6vh;
}

section#skills div.skills-subgrid h3 {
	font-size: 1em;
	letter-spacing: 3.5px;
	margin-bottom: 3vh;
	margin-top: 3.7vh;
	line-height: 1.5em;
	padding-right: 10px;
}

section#skills div.skills-subgrid li {
	list-style: none;
	letter-spacing: 3px;
	justify-self: start;
	line-height: 2.5em;
}

section#skills div.skills-subgrid ul {
	align-self: start;
	padding-left: 0;
	padding-right: 10px;
	margin-block-end: 0;
	margin-bottom: 3vh;
	margin-top: 3vh;
}

section#skills div.skills-subgrid:nth-of-type(1) ul {
	height: 100%;
}

/** WORK */

section#work {
	display: grid;
	grid-template-columns: 1.5fr 3fr 2.03fr;
	margin-bottom: 50vh;
}

section#work:focus {
	outline: none;
	box-shadow: 0 0 10px #00e8ac;
}

section#work div#work-animation {
	grid-column-start: 3;
	transform: translateX(5vw);
}

section#work div#work-animation g g g:first-of-type {
	display: none;
}

section#work div.work-grid {
	align-self: center;
	grid-column-start: 2;
	grid-row-start: 1;
	min-width: 630px;
}

section#work div.project-container {
	margin: 8vh 0;
}

section#work div.project-container a {
	text-decoration: none;
}

section#work div.project {
	display: flex;
	align-items: baseline;
	/* flex-wrap: nowrap; */
	color: #231f1f;
}

section#work div.project span.date {
	font-size: 1.3rem;
}

section#work div.project span.title {
	text-decoration: none;
	font-size: 3rem;
	margin-left: 30px;
}

section#work div.project span.title:after {
	content: "";
	background-image: url(/static/Highlighter.svg);
	display: block;
	height: 21px;
	max-width: 0;
	transform: translateY(-10px);
	background-repeat: no-repeat;
	transition: max-width ease-out 0.3s;
}

section#work div.project span.title:hover:after {
	content: "";
	background-image: url(/static/Highlighter.svg);
	display: block;
	height: 21px;
	max-width: 100%;
	transform: translateY(-10px);
	background-repeat: no-repeat;
}

section#work div.project-container:hover span.title,
section#work div.project-container:focus span.title {
	background-position-y: 2.5rem;
}

section#work div.project-details {
	color: #231f1f;
	font-size: 1rem;
	display: none;
	position: absolute;
	z-index: 1;
	transform: translate(17rem, 0.3rem);
	border-radius: 1%;
	background-color: #00e8ac;
	width: 400px;
	height: fit-content;
	padding: 10px;
}

section#work div.project-container:hover div.project-details,
section#work div.project-container:focus div.project-details {
	display: block;
}

.ad-message {
	font-weight: 600;
}

/** Footer  */
footer {
	display: flexbox;
	font-size: 1rem;
	padding-bottom: 5vh;
}

footer a {
	margin: 0 30px;
	transition: color 0.1s linear;
	text-decoration: none;
	color: #666666;
	letter-spacing: 3px;
	width: fit-content;
}

footer a:focus,
footer a:hover {
	color: #00e8ac;
	cursor: pointer;
}

footer a:focus {
	outline: none;
	border-bottom: 1px solid #00e8ac;
}

/** TABLET STYLES */
@media (max-width: 740px) {
	html {
		font-size: 90%;
	}
	body {
		font-size: 8px;
	}

	#face {
		width: 150px;
	}

	section#skills div.skills-subgrid h3 {
		padding-right: 20px;
	}

	section#skills div.skills-subgrid ul {
		padding-right: 20px;
	}

	section#work div.project-details {
		transform: translate(30vw, -20vh);
	}
}

