/* MOBILE */
@media (max-width: 600px) {
	html {
		font-size: 72%;
	}

	header {
		justify-items: start;
	}

	#face {
		width: 100px;
		top: 15px;
		height: 100px;
		margin-bottom: 2rem;
		margin-top: -6rem;
	}

	#face.stuck {
		background-size: 80%;
		height: 88px;
		width: 100px;
	}

	section#work div#work-animation,
	section#skills div#skills-animation {
		transform: rotate(-85deg);
		height: 90vw;
	}

	section#intro {
		margin: 0 2rem;
	}

	section#skills {
		display: block;
		margin: 7rem 2rem 0;
	}

	section#skills div.skills-grid div.reveal:first-of-type {
		float: left;
		margin-right: 20vw;
	}

	section#skills div.skills-subgrid {
		display: inline-block;
	}

	section#work {
		display: block;
		margin: 7rem 2rem 20rem;
	}

	section#work div.work-grid {
		display: inline;
	}

	section#work div.project {
		display: block;
	}

	section#work div.project span.date {
		display: block;
	}

	section#work div.project span.title {
		margin-left: 0;
	}

	section#work div.project-details {
		display: block;
		position: static;
		width: fit-content;
	}

	.reveal {
		transform: translateY(20vh) skewX(0deg);
	}

	section#work div.project-details.reveal {
		opacity: 0;
		transform: translateY(20vh) skewX(0);
		transition: all 1s ease-out;
	}

	section#work div.project-details.reveal.revealed {
		opacity: 1;
		transform: translateY(0px) skewX(0deg);
	}

	footer {
		display: flex;
		justify-content: space-evenly;
	}

	footer a {
		margin: 0;
	}
}

@media (max-width: 480px) {
	header a.first,
	header a.second {
		visibility: hidden;
		margin-bottom: 2rem;
		width: 150px;
		top: 0;
		height: 100px;
		margin-top: -6rem;
	}

	section#skills {
		font-size: 1.3rem;
	}

	section#skills div#skills-animation {
		margin: 19vh 0;
	}

	section#skills div.skills-grid h2 {
		display: none;
	}

	section#skills div.skills-subgrid ul {
		margin: 0;
	}
	section#skills div.skills-subgrid ul li {
		margin: 5px 0;
	}

	section#work div.project-details {
		font-size: 1.25rem;
	}

	section#work div.project-container {
		margin: 25vh 0;
	}

	main.contact {
		margin: 2vh;
	}

	main.contact p#email {
		font-size: 3rem;
	}

	main.contact p#email::selection {
		background-color: transparent;
		color: #00e8ac;
	}

	main.contact + footer {
		display: none;
	}

	footer {
		flex-wrap: wrap;
	}

	footer a {
		margin: 0 20px 20px;
	}
}
